import React, { useEffect } from "react";
import "./App.css";

import api from "./api/api";

function App() {
  useEffect(() => {
    api.get("/users").then(response => console.log(response));
  }, []);

  return (
    <div className="App">
      <p>TeSt</p>
    </div>
  );
}

export default App;
